import { OrderDataTypes } from "../constant/types"

interface CountValuesProps {
    orderData?:OrderDataTypes
}

const CountValues = ({orderData}:CountValuesProps) =>{
    return(
        <div className="bg-[#F6F8F9] shadow-[0px 3px 6px 0px #0000000F] rounded-[16px] border-[#0E253C1A] border-[1px]">
             <img src={`images/${orderData?.icon}`} className="cursor-pointer" alt='add' />
             <div>
                <p className="text-[#0E253CD9] text-sm font-medium">{orderData?.label}</p>
                <p className="text-[#0E253C] text-[22px] font-semibold">{orderData?.value}</p>
             </div>
            <div>
            <p className="text-[#0E253CD9] text-sm font-medium">{orderData?.upDown}</p>
            <p className="text-[#0E253C] text-[22px] font-semibold">From{orderData?.time}</p>
            </div>
        </div>
    )
}

export default CountValues
